import { EditIcon, ArrowLeftIcon } from 'lucide-react-native';


import React from 'react';
import { GluestackUIProvider, Box, Text, VStack } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';
export default function App() {
  return <GluestackUIProvider config={config}>
    <VStack space="md" reversed={false} backgroundColor='$black' alignItems='center'>
      <Box w={500} h={500} bg="#0C0C0C" marginTop={15} borderWidth={'$1'} borderColor='cyan' marginBottom={200} >
      <Button action={"primary"} bg="$cyan300" variant={"solid"} size={"lg"} isDisabled={false}>
        <ButtonText>
          Button
        </ButtonText>
      </Button>
</Box>
    </VStack>
  </GluestackUIProvider>;
}
